import React from "react";
//import Pion from './Pions';
import './style.css';

const Case = () => {

    const Pion = () => {
        return (
            <div className="pion"></div>
        )
    }

    const changeColor = (e) => {
        if (e.target.classList.contains('clicked')) {
            return (
                <div className="pion"></div>
            )
        }
    }

    return (
        <div className="rondCases" onClick={changeColor}>
            <Pion />
        </div>
    )
}

export default Case;
